import React from 'react';

const FilePreview = () => {
  // Use the location to build the complete URL to the file
  const { pathname } = window.location;
  const fileUrl = `${window.location.origin}${pathname}`;

  return (
    <div>
      <h2>File Preview</h2>
      <iframe src={fileUrl} title="File Preview" width="100%" height="500px" />
    </div>
  );
};

export default FilePreview;
